import React, {useEffect, useState, useRef} from "react";

function usePrevious(value) {
  const ref = useRef(value); // Initiera med 'value' när komponenten skapas
  useEffect(() => {
    ref.current = value;
  }, [value]);
  return ref.current;
}

function SidaSammanlagdStats({patienter}) {
  const [currentInlagda, setCurrentInlagda] = useState(0);

  const prevInlagda = usePrevious(currentInlagda);

  useEffect(() => {
    setCurrentInlagda(patienter.length);
  }, [patienter]);

  return (
    <>
      <div className="tittel">
        <h1>Statistik filtrerad</h1>
      </div>
      <p>current: {currentInlagda}</p>
      <p>prev: {prevInlagda}</p>
    </>
  );
}

export default SidaSammanlagdStats;
